        "properties": {
          "DnsRecords": {
            "allOf": [
              { "$ref": "#/components/schemas/DnsRecordList" },
              {
                "description": "An array that contains one <code>DnsRecord</code> object for each Route 53 record that you want AWS Cloud Map to create when you register an instance."
              }
            ]
